import { WizardLayout } from '../components/WizardLayout';
import { Steps, Popover } from 'antd';

const Pay = () => (
  <WizardLayout title="Araka | Payment">
    <Steps progressDot current={1}>
      <Steps.Step title="Payment Type" />
      <Steps.Step title="Provider" />
      <Steps.Step title="Details" />
      <Steps.Step title="Summary" />
      <Steps.Step title="Pay" />
    </Steps>
  </WizardLayout>
);

export default Pay;
